:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Cyril Nelson Beetham and WILDER, Maud Margaret (Pearlie)
  JWILLIAMS, Joan Wilder and JONES, Evan
  03> WILLIAMS, Joan Wilder m on 09.09.1936 to JONES, Evan
  b 12.06.1911 d 17.05.1990
  b ** ** 1907 d 20.09.1969
  Joan b. at Napier and m, at St Stephen's Church, Elsthorpe. Evan b. at
  Cardiganshire, Wales.
  Evan was educated at Towyn Grammar School and studied medicine at St Thomas'
  Hospital, London (MB 1931). He became Resident Medical Officer at the National
  Heart Hospital and later returned to St Thomas' as Senior Physician.
  For many years they lived at Heatherwood, Pirbright, where many New Zealand
  relations were made warmly welcome.
  04> WILLIAMS, Patricia Wilder m on 27.02.1942 to KELLY, George Murray Swinburne
  b 19.10.1912 d 31.05.1981
  b 14.02.1904 d 22.05.1970
  Patricia b. at Napier and m, at St Matthew's Church, Hastings. Swinburne, s/o George Kelly
  and Janet Murray Polson.
  Pat and Swinburne farmed at "Rotoma", Hastings. Swinburne was educated at Heretaunga School
  and Wanganui Collegiate. He was a co-founder of the New Zealand Pony Club and a keen polo
  player.
  Pat was a skilled gardener. A founding member of the Waipahihi Botanical Society in Taupo,
  she was part of a small group which established and developed the Botanical Gardens at the top of Shepherds
  Road. In an area of the memorial section of the Gardens dedicated to her memory, there is an unusual and
  attractive weeping camellia which was transplanted from her own garden after her death.
  01> KELLY, Joan Margaret m on 27.02.1965 to GRIFFITHS, William Hugh
  b 28.03.1943
  b 17.10.1940
  Joan b, at Hastings and m, at St Mathew's Church, Hastings. Hugh, s/o Col RF V Griffiths and M Spence,
  b. at Bath, England. Address: Glen-Yr-Afon, RD 7, Feilding.
  Joan was educated at Raukawa School, Queenswood School and Woodford House. Her interests include golf
  and dog trials. Hugh was educated at Cheltenham College, England and is a farmer and dog trial judge.
  Their farm, "Glen-yr-Afon" at Poukiore, Hunterville comprised 380 acres purchased in 1970 with a
  further 360 acres purchased in 1974 and 450 acres at Ohingaiti purchased in 1984. They were all sold in
  1989 when Joan and Hugh purchased a 470 acre sheep and beef property at Kimbolton, also called
  "Glen-yr-Afon".
  01> GRIFFITHS, Bridget Jane m on 18.05.1996 to LITTIN, Jeffrey Donald
  b 18.03.1966
  b 18.05.1996
  Bridget b. at Hunterville. Address: 60 Ranstead Road, RD 4, Hamilton.
  Bridget was educated at Hunterville and Wanganui Girls' Collegiate and graduated BA in English and
  French from Waikato University (1984-86) and BAg from Massey University. She and Joff have a dairy
  farm near Cambridge.
  01> LITTIN, George Jeffrey
  b 11.10.1997
  02> GRIFFITHS, Anna Mareem on 11.12.1987 to ROBERTSON, John Barry
  b 18.03.1966
  b 20.10.1965
  Anna b. at Hunterville and m, at St John's Anglican Church, Hunterville. Address: 3 Dalkieth Lane,
  Belmont, Lower Hutt.
  Anna was educated at Hunterville Consolidated Primary School, Wanganui Girls' College (1979-83,
  boarder), Massey University (1984-86, BSc in Geography) and Palmerston North Teachers College
  (1987-88, DipTchg). In 1983 she was Wanganui Schools representative on an Australian cross country
  tour. Anna is a primary teacher at Muritai School, Eastbourne (1989-92). Her interests include
  triathlons and running. She is actively involved in the Lower Hutt Baptist Church.
  John attended Wanganui Collegiate School (1979-83) and Massey University (Bachelor of Bus Studies).
  He holds an ACA and is an accountant with Sherwin Chan & Walshe in Lower Hutt. His interests
